var maximumSum = function(nums) {
    const maxVal = Math.max(...nums);
    const sqrtMaxVal = Math.floor(Math.sqrt(maxVal)) + 1;
    const spf = new Array(maxVal + 1); // Smallest Prime Factor
    for (let i = 2; i <= maxVal; ++i) spf[i] = i;
    for (let i = 2; i * i <= maxVal; ++i) {
        if (spf[i] === i) {
            for (let j = i * i; j <= maxVal; j += i) {
                if (spf[j] === j) spf[j] = i;
            }
        }
    }

    const factorize = (x) => {
        const factors = new Map();
        while (x !== 1) {
            let count = 0;
            const factor = spf[x];
            while (spf[x] === factor) {
                x /= factor;
                count ^= 1; // Toggle between 0 and 1 for odd/even powers
            }
            if (count) factors.set(factor, 1);
        }
        return factors;
    };

    const getKey = (factors) => Array.from(factors.keys()).sort().join(',');

    const sums = new Map();
    nums.forEach((num) => {
        const factors = factorize(num);
        const key = getKey(factors);
        sums.set(key, (sums.get(key) || 0) + num);
    });

    let maxSum = 0;
    sums.forEach((sum) => {
        maxSum = Math.max(maxSum, sum);
    });

    return maxSum;
};
